import React from "react";

const Mouse = () => {
  state = {
    base: [
      {
        height: "70px",
        width: "70px",
        borderRadius: 300,
        border: "2px solid red",
        position: "absolute"
      }
    ]
  };

  return (
    <div>
      <div className="circle" style={this.base}></div>
    </div>
  );
};

export default Mouse;
